import React from 'react'
import Navbar from './Navbar'
import FilterCard from './FilterCard'
import Job from './Job'

function Jobs() {
  const jobsArray = [1, 2, 3, 4, 5, 6, 7, 8];
  return (
    <div className='bg-wanrin'>
      <Navbar />
      <div className='m-4'>
        <div>
          <FilterCard />
        </div>
        
          {
            jobsArray.length < 0 ? <span>Job jot found</span> :(
              <div className='jobcards my-5'>
                  {
                    jobsArray.map((item, index) => <Job />)
                  }
              </div>
            )
          }
        
      </div>
    </div>
  )
}

export default Jobs
